import React from "react"

class SearchJob extends React.Component {
    render() {
        return (
            <div style={styles.container}>
                <form>
                    <label>
                        Description:
                        <input type="text" name="description"/>
                    </label>
                    <label>
                        Location:
                        <input type="text" name="description"/>
                    </label>
                    <input type="submit" value="Submit"/>
                </form>
            </div>
        )
    }
}

const styles = {
    container: {
        width: "100%",
        padding: 20,
        backgroundColor: "#e1e1e1"
    }
};

export default SearchJob;
